const mongoose = require("mongoose");

/**
 * @swagger
 * components:
 *  schemas:
 *   Ingredients:
 *    type: object
 *    properties:
 *     ingredientList:
 *      type: array
 *    required:
 *     - ingredientList
 */

const ingredientsSchema = new mongoose.Schema({
    _id: false,
    ingredientsList: { type: String, required: true }
});

/**
 * @swagger
 * components:
 *  schemas:
 *   Calories:
 *    type: object
 *    properties:
 *     servings:
 *      type: number
 *     calories:
 *      type: number
 *    required:
 *     - servings
 *     - calories
 */

const caloriesSchema = new mongoose.Schema({
    _id: false,
    servings: { type: Number, required: true },
    calories: { type: Number, required: true }
});

/**
 * @swagger
 * components:
 *  schemas:
 *   DodajanjeRecepta:
 *    type: object
 *    properties:
 *     userID:
 *      type: string
 *      example: jjNovak
 *     name:
 *      type: string
 *      example: Salmon with brown sugar glaze
 *     description:
 *      type: string
 *      example: Brown Sugar Glazed Salmon is a simple and delicious way to kick your salmon up a notch! I love the contrast of the light and flakey salmon with a sweet brown sugar glaze. It's easy enough to put together for a weeknight dinner and the kids love it too!
 *     img:
 *      type: string
 *      example: data:image/jpeg;base64,"
 *     preparation:
 *      type: Number
 *      example: 10
 *     cooking:
 *      type: Number
 *      example: 10
 *     instructions:
 *      type: string
 *      example: Skuhaj
 *     stars:
 *      type: array
 *      min: 0
 *      max: 5
 *      example:
 *       - 3
 *       - 4
 *     avg:
 *      type: number
 *      example: 3
 *     ingredients:
 *      type: Ingredients
 *      example:
 *       - Salmon
 *       - Voda
 *     calories:
 *      type: Calories
 *      example:
 *       servings: 1
 *       calories: 160
 *    required:
 *     - userID
 *     - name
 *     - description
 *     - img
 *     - preparation
 *     - cooking
 *     - instruction
 *     - stars
 *     - avg
 *     - ingredients
 *     - calories
 *   SpreminjanjeRecepta:
 *    type: object
 *    properties:
 *     userID:
 *      type: string
 *      example: jjNovak
 *     name:
 *      type: string
 *      example: Bread
 *     description:
 *      type: string
 *      example: Simple White Bread.
 *     img:
 *      type: string
 *      example: 
 *     preparation:
 *      type: Number
 *      example: 20
 *     cooking:
 *      type: Number
 *      example: 20
 *     instructions:
 *      type: string
 *      example: Speci
 *     stars:
 *      type: array
 *      min: 0
 *      max: 5
 *      example:
 *       - 3
 *       - 4
 *     avg:
 *      type: number
 *      example: 3
 *     ingredients:
 *      type: Ingredients
 *      example:
 *       - Flour
 *       - Water
 *     calories:
 *      type: Calories
 *      example:
 *       servings: 3
 *       calories: 500
 *    required:
 *     - userID
 *     - name
 *     - description
 *     - img
 *     - preparation
 *     - cooking
 *     - instruction
 *     - stars
 *     - avg
 *     - ingredients
 *     - calories
 */

const recipesSchema = new mongoose.Schema({
    userID: { type: String, required: true },
    name: { type: String, required: true },
    description: { type: String, required: true },
    img: { type: String, required: true },
    preparation: { type: Number, required: true },
    cooking: { type: Number, required: true },
    instructions: { type: String, required: true },
    stars: [{ type: Number, min: 0, max: 5 }],
    avg: { type: Number, default: 0, min: 0, max: 5 },
    ingredients: ingredientsSchema,
    calories: caloriesSchema,
});

mongoose.model("Recipe", recipesSchema, "Recipes");